-- ----------------------------
-- Table structure for cross_battle
-- ----------------------------
DROP TABLE IF EXISTS `cross_battle`;
CREATE TABLE `cross_battle` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `round_id` int(11) NOT NULL COMMENT '比赛届数',
  `guild_1_id` int(11) NOT NULL COMMENT '公会1',
  `guild_2_id` int(11) NOT NULL COMMENT '公会2',
  `map_type` int(11) NOT NULL COMMENT '地图编号',
  `start_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '开始时间',
  `real_start_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '实际处理开始时间',
  `change_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '攻防转换时间',
  `attack_area` varchar(256) NOT NULL COMMENT '攻方进度',
  `status` int(11) NOT NULL COMMENT '状态 0未开始 1攻击准备 2攻击 3中场结算 4防御准备 5防御 6整场结算 7比赛结束',
  `guild_1_beat` int(11) NOT NULL DEFAULT '0' COMMENT '上半场是否攻入大本营',
  `guild_2_beat` int(11) NOT NULL DEFAULT '0' COMMENT '下半场是否攻入大本营',
  `guild_1_time` int(11) NOT NULL DEFAULT '0' COMMENT '战斗时长',
  `guild_2_time` int(11) NOT NULL DEFAULT '0' COMMENT '战斗时长',
  `guild_1_kill` int(11) NOT NULL DEFAULT '0' COMMENT '杀敌数量',
  `guild_2_kill` int(11) NOT NULL DEFAULT '0' COMMENT '杀敌数量',
  `first_blood_1` int(11) NOT NULL DEFAULT '0' COMMENT '一血玩家id(上)',
  `first_blood_2` int(11) NOT NULL DEFAULT '0' COMMENT '一血玩家id(下)',
  `win` int(11) NOT NULL DEFAULT '0' COMMENT '胜者，1or2',
  `create_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  `reward_flag` int(2) DEFAULT '0' COMMENT '0:未发奖 1：已发奖',
  PRIMARY KEY (`id`),
  KEY `status` (`status`,`guild_1_id`,`guild_2_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Table structure for cross_common_log
-- ----------------------------
DROP TABLE IF EXISTS `cross_common_log`;
CREATE TABLE `cross_common_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `battle_id` int(11) NOT NULL,
  `player_id` int(11) NOT NULL,
  `guild_id` int(11) NOT NULL,
  `memo` text COLLATE utf8_unicode_ci NOT NULL,
  `create_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`),
  KEY `player_id` (`player_id`) USING BTREE,
  KEY `battle_id` (`battle_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

-- ----------------------------
-- Table structure for cross_guild
-- ----------------------------
DROP TABLE IF EXISTS `cross_guild`;
CREATE TABLE `cross_guild` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `round_id` int(11) NOT NULL COMMENT '轮次',
  `battle_id` int(11) NOT NULL,
  `guild_id` int(11) NOT NULL,
  `founder` int(11) DEFAULT '0' COMMENT '联盟创始人',
  `leader_player_id` int(11) NOT NULL DEFAULT '0' COMMENT '联盟老大',
  `leader_player_nick` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `name` varchar(100) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '联盟名称',
  `short_name` varchar(50) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '短名称',
  `icon_id` int(11) DEFAULT '0' COMMENT '联盟图标',
  `score` int(11) NOT NULL DEFAULT '0',
  `rank` int(11) NOT NULL DEFAULT '0',
  `buff_move` float NOT NULL DEFAULT '0' COMMENT '行军加成（百分比）',
  `buff_move_ids` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '[]' COMMENT '行军加成技能',
  `buff_cityattack` float NOT NULL DEFAULT '0' COMMENT '攻城伤害加成（百分比）',
  `buff_cityattack_ids` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '[]' COMMENT '攻城伤害加成技能',
  `buff_buildattack` float NOT NULL DEFAULT '0' COMMENT '器械伤害加成（百分比）',
  `buff_buildattack_ids` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '[]' COMMENT '器械伤害加成技能',
  `buff_relocation` float NOT NULL DEFAULT '0' COMMENT '迁城cd加成',
  `buff_relocation_ids` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '[]' COMMENT '迁城cd加成技能',
  `buff_enemyreturn` float NOT NULL DEFAULT '0' COMMENT '对手城池复活加成',
  `buff_enemyreturn_ids` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '[]' COMMENT '对手城池复活加成技能',
  `create_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `update_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `rowversion` char(13) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `battle_id` (`battle_id`,`guild_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='联盟总表';

-- ----------------------------
-- Table structure for cross_guild_info
-- ----------------------------
DROP TABLE IF EXISTS `cross_guild_info`;
CREATE TABLE `cross_guild_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `guild_id` int(11) NOT NULL DEFAULT '0' COMMENT '联盟id，加哥通用方法',
  `match_score` int(11) DEFAULT '0' COMMENT '匹配积分',
  `create_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `update_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `win_times` int(11) DEFAULT '0' COMMENT '胜利次数',
  `lose_times` int(11) DEFAULT '0' COMMENT '失败次数',
  `joined_times` int(11) DEFAULT '0' COMMENT '参加轮次',
  `latest_battle_is_win` int(2) DEFAULT '-1' COMMENT '最近一次匹配是否胜利 1：胜 0：败 -1:首次',
  `status` int(2) DEFAULT '0' COMMENT '是否参赛 0：否 ， 1：是',
  PRIMARY KEY (`id`),
  KEY `guild_id` (`guild_id`),
  KEY `last` (`latest_battle_is_win`,`status`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='跨服联盟基础信息表';

-- ----------------------------
-- Table structure for cross_map
-- ----------------------------
DROP TABLE IF EXISTS `cross_map`;
CREATE TABLE `cross_map` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `battle_id` int(11) NOT NULL COMMENT '战斗表关联id',
  `x` int(11) DEFAULT '0' COMMENT '坐标x点',
  `y` int(11) DEFAULT '0' COMMENT '坐标y点',
  `block_id` int(11) NOT NULL COMMENT '单元格id floor(x/12)+floor(y/12)*102',
  `area` int(11) DEFAULT '0' COMMENT '所属区块',
  `map_element_id` int(11) DEFAULT '0' COMMENT '地图明细id',
  `map_element_origin_id` int(11) DEFAULT '0' COMMENT 'map_element.origin_id',
  `map_element_level` int(11) DEFAULT '1' COMMENT 'map element的等级',
  `topography` int(11) NOT NULL DEFAULT '0' COMMENT '0 正常 1 山 2 水',
  `guild_id` int(11) DEFAULT '0' COMMENT '帮会id',
  `player_id` int(11) DEFAULT '0' COMMENT '玩家id',
  `resource` int(11) DEFAULT '0',
  `durability` int(11) NOT NULL DEFAULT '0' COMMENT '建筑耐久度',
  `max_durability` int(11) NOT NULL DEFAULT '0' COMMENT '建筑最大耐久度',
  `next_area` int(11) NOT NULL DEFAULT '0' COMMENT '城门打开后的area',
  `target_area` int(11) NOT NULL COMMENT '床弩目标地区',
  `player_num` int(11) NOT NULL DEFAULT '0' COMMENT '天梯/攻城锤驻守人数',
  `status` int(11) NOT NULL DEFAULT '1' COMMENT '0 建造中 1 正常',
  `update_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `create_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `build_time` timestamp NULL DEFAULT '0000-00-00 00:00:00' COMMENT 'durability增加时记录的时间',
  `attack_time` timestamp NULL DEFAULT '0000-00-00 00:00:00' COMMENT '最后攻击时间',
  `attack_cd` int(11) NOT NULL DEFAULT '0' COMMENT '攻击间隔（秒）',
  `attack_times` int(11) NOT NULL DEFAULT '0' COMMENT '攻击次数',
  `recover_time` timestamp NULL DEFAULT '0000-00-00 00:00:00' COMMENT '恢复开始时间',
  `rowversion` int(11) DEFAULT '0',
  PRIMARY KEY (`id`),
  UNIQUE KEY `xy` (`x`,`y`,`battle_id`),
  KEY `guild_id` (`guild_id`) USING BTREE,
  KEY `player_id` (`player_id`) USING BTREE,
  KEY `block` (`area`) USING BTREE,
  KEY `map_element_origin_id` (`map_element_origin_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

-- ----------------------------
-- Table structure for cross_map_config
-- ----------------------------
DROP TABLE IF EXISTS `cross_map_config`;
CREATE TABLE `cross_map_config` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `area` int(11) NOT NULL COMMENT '所属区域',
  `map_type` int(11) NOT NULL COMMENT '地图编号',
  `x` int(11) NOT NULL COMMENT '横坐标',
  `y` int(11) NOT NULL COMMENT '竖坐标',
  `sides_type` int(11) NOT NULL DEFAULT '0',
  `cross_map_element_id` int(11) NOT NULL COMMENT '地图元素编号 0不可用 1空地 2冲车 3云梯 4床弩 5投石 6城门 7大本营',
  `max_durability` int(11) NOT NULL COMMENT '最大耐久度',
  `next_area` int(11) DEFAULT '0' COMMENT '可开启下一区域',
  `target_area` int(11) DEFAULT '0' COMMENT '攻击目标',
  `build_num` int(11) NOT NULL DEFAULT '0',
  `memo` varchar(256) NOT NULL COMMENT '注释信息',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Table structure for cross_player
-- ----------------------------
DROP TABLE IF EXISTS `cross_player`;
CREATE TABLE `cross_player` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `round_id` int(11) NOT NULL COMMENT '轮次id',
  `battle_id` int(11) NOT NULL,
  `player_id` int(11) NOT NULL,
  `server_id` int(5) NOT NULL DEFAULT '1' COMMENT '服务器id',
  `nick` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `avatar_id` int(5) NOT NULL,
  `level` int(11) NOT NULL,
  `castle_lv` int(11) NOT NULL DEFAULT '0',
  `guild_id` int(11) NOT NULL,
  `wall_durability` int(11) NOT NULL DEFAULT '0' COMMENT '城墙耐久度',
  `wall_durability_max` int(11) NOT NULL DEFAULT '0' COMMENT '城墙最大耐久度',
  `prev_x` int(11) NOT NULL DEFAULT '0',
  `prev_y` int(11) NOT NULL DEFAULT '0',
  `status` int(11) NOT NULL DEFAULT '0' COMMENT '0.未进入战场，1.已进入战场',
  `kill_soldier` int(11) NOT NULL DEFAULT '0' COMMENT '杀兵数',
  `continue_kill` int(11) NOT NULL DEFAULT '0' COMMENT '连杀人数',
  `change_location_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '上一次迁城时间',
  `is_dead` int(11) NOT NULL DEFAULT '0' COMMENT '是否死亡',
  `dead_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '死亡时间',
  `dead_times` int(11) NOT NULL DEFAULT '0' COMMENT '死亡次数',
  `skill_first_recover` int(11) NOT NULL DEFAULT '0' COMMENT '不屈之力',
  `buff` text COLLATE utf8_unicode_ci NOT NULL COMMENT 'buff',
  `debuff_queuetime` int(11) NOT NULL DEFAULT '0' COMMENT '下次出征行军时间延长(秒)',
  `create_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `update_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `rowversion` char(13) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `battle_id` (`battle_id`,`player_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

-- ----------------------------
-- Table structure for cross_player_army
-- ----------------------------
DROP TABLE IF EXISTS `cross_player_army`;
CREATE TABLE `cross_player_army` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `battle_id` int(11) NOT NULL,
  `player_id` int(11) NOT NULL,
  `position` int(11) NOT NULL COMMENT '军团位置',
  `leader_general_id` int(11) NOT NULL COMMENT '领队武将',
  `status` int(11) NOT NULL COMMENT '状态：0-无；1-行军',
  `create_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `update_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `rowversion` char(13) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `player_id` (`battle_id`,`player_id`,`position`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

-- ----------------------------
-- Table structure for cross_player_army_unit
-- ----------------------------
DROP TABLE IF EXISTS `cross_player_army_unit`;
CREATE TABLE `cross_player_army_unit` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `battle_id` int(11) NOT NULL,
  `player_id` int(11) NOT NULL,
  `army_id` int(11) NOT NULL COMMENT '军团编号',
  `unit` int(11) NOT NULL COMMENT '编队序号',
  `general_id` int(11) NOT NULL COMMENT '武将id',
  `soldier_id` int(11) NOT NULL COMMENT '士兵id',
  `soldier_num` int(11) NOT NULL COMMENT '士兵数量',
  `last_soldier_id` int(11) NOT NULL DEFAULT '0',
  `create_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `update_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `rowversion` char(13) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `player_id` (`battle_id`,`player_id`,`army_id`,`unit`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

-- ----------------------------
-- Table structure for cross_player_general
-- ----------------------------
DROP TABLE IF EXISTS `cross_player_general`;
CREATE TABLE `cross_player_general` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `battle_id` int(11) NOT NULL,
  `player_id` int(11) NOT NULL,
  `general_id` int(11) NOT NULL COMMENT '武将初始id',
  `exp` int(11) NOT NULL COMMENT '经验',
  `lv` int(11) NOT NULL COMMENT '等级',
  `star_lv` int(11) NOT NULL DEFAULT '0' COMMENT '星级',
  `weapon_id` int(11) NOT NULL COMMENT '武器id',
  `armor_id` int(11) NOT NULL COMMENT '装备id',
  `horse_id` int(11) NOT NULL COMMENT '坐骑id',
  `zuoji_id` int(11) NOT NULL DEFAULT '0' COMMENT '坐骑',
  `skill_lv` int(11) NOT NULL DEFAULT '0' COMMENT '技能等级',
  `build_id` int(11) NOT NULL COMMENT '驻守建筑id',
  `army_id` int(11) NOT NULL COMMENT '军团id',
  `force_rate` int(11) NOT NULL DEFAULT '0' COMMENT 'force成长率',
  `intelligence_rate` int(11) NOT NULL DEFAULT '0' COMMENT 'intelligence成长率',
  `governing_rate` int(11) NOT NULL DEFAULT '0' COMMENT 'governing成长率',
  `charm_rate` int(11) NOT NULL DEFAULT '0' COMMENT 'charm成长率',
  `political_rate` int(11) NOT NULL DEFAULT '0' COMMENT 'political成长率',
  `stay_start_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '驻守上次结算经验时间',
  `cross_skill_id_1` int(11) NOT NULL DEFAULT '0',
  `cross_skill_lv_1` int(11) NOT NULL DEFAULT '0',
  `cross_skill_v1_1` float NOT NULL DEFAULT '0',
  `cross_skill_v2_1` float NOT NULL DEFAULT '0',
  `cross_skill_id_2` int(11) NOT NULL DEFAULT '0',
  `cross_skill_lv_2` int(11) NOT NULL DEFAULT '0',
  `cross_skill_v1_2` float NOT NULL DEFAULT '0',
  `cross_skill_v2_2` float NOT NULL DEFAULT '0',
  `cross_skill_id_3` int(11) NOT NULL DEFAULT '0',
  `cross_skill_lv_3` int(11) NOT NULL DEFAULT '0',
  `cross_skill_v1_3` float NOT NULL DEFAULT '0',
  `cross_skill_v2_3` float NOT NULL DEFAULT '0',
  `status` int(11) NOT NULL COMMENT '0-普通，1-出征，2-学习',
  `total_attr` text COLLATE utf8_unicode_ci NOT NULL,
  `create_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `update_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `rowversion` char(13) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `player_id` (`battle_id`,`player_id`,`general_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

-- ----------------------------
-- Table structure for cross_player_masterskill
-- ----------------------------
DROP TABLE IF EXISTS `cross_player_masterskill`;
CREATE TABLE `cross_player_masterskill` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `battle_id` int(11) NOT NULL,
  `player_id` int(11) NOT NULL,
  `general_id` int(11) NOT NULL DEFAULT '0',
  `skill_id` int(11) NOT NULL DEFAULT '0',
  `lv` int(11) NOT NULL DEFAULT '1',
  `all_times` int(11) NOT NULL DEFAULT '0' COMMENT '总次数',
  `rest_times` int(11) NOT NULL DEFAULT '0' COMMENT '剩余次数',
  `active` int(11) NOT NULL DEFAULT '0' COMMENT '激活中',
  `v1` float NOT NULL DEFAULT '0',
  `v2` float NOT NULL DEFAULT '0',
  `create_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `update_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `rowversion` char(13) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `battle_id` (`battle_id`,`player_id`,`general_id`,`skill_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

-- ----------------------------
-- Table structure for cross_player_project_queue
-- ----------------------------
DROP TABLE IF EXISTS `cross_player_project_queue`;
CREATE TABLE `cross_player_project_queue` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `battle_id` int(11) NOT NULL,
  `player_id` int(11) NOT NULL COMMENT '动作玩家id',
  `type` int(11) NOT NULL COMMENT '动作类型 1 侦查 2 战斗 3 采集',
  `target_player_id` int(11) NOT NULL DEFAULT '0' COMMENT '目标玩家id',
  `target_info` varchar(512) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '目标情况[json数组]',
  `status` int(11) NOT NULL DEFAULT '1' COMMENT '状态 1进行中 2已完成 3已撤销',
  `create_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `end_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '完成时间',
  `accelerate_info` varchar(1024) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '使用加速数据 (时间,加速类型;...)',
  `army_id` int(11) NOT NULL DEFAULT '0',
  `guild_id` int(11) NOT NULL DEFAULT '0',
  `carry_gold` bigint(20) NOT NULL DEFAULT '0' COMMENT '携带-金',
  `carry_food` bigint(20) NOT NULL DEFAULT '0' COMMENT '携带-粮',
  `carry_wood` bigint(20) NOT NULL DEFAULT '0' COMMENT '携带-木',
  `carry_stone` bigint(20) NOT NULL DEFAULT '0' COMMENT '携带-石',
  `carry_iron` bigint(20) NOT NULL DEFAULT '0' COMMENT '携带-铁',
  `carry_soldier` varchar(1024) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '携带兵[[soldier_id,soldier_num]...]',
  `carry_item` varchar(1024) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '携带道具drop',
  `area` int(11) NOT NULL DEFAULT '0',
  `from_map_id` int(11) NOT NULL DEFAULT '0' COMMENT '源地址，无则为0',
  `to_map_id` int(11) NOT NULL DEFAULT '0' COMMENT '目标地址，无则为0',
  `from_x` int(11) NOT NULL DEFAULT '0' COMMENT 'map from x',
  `from_y` int(11) NOT NULL DEFAULT '0' COMMENT 'map from y',
  `to_x` int(11) NOT NULL DEFAULT '0' COMMENT 'map to x',
  `to_y` int(11) NOT NULL DEFAULT '0' COMMENT 'map to y',
  `parent_queue_id` int(11) NOT NULL DEFAULT '0',
  `battle` int(11) NOT NULL DEFAULT '0' COMMENT '0:无战斗，1：战斗胜利，2：战斗失败',
  `update_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `rowversion` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `target_player_id` (`target_player_id`) USING BTREE,
  KEY `status` (`status`,`end_time`,`type`) USING BTREE,
  KEY `to_map_id` (`to_map_id`) USING BTREE,
  KEY `battle_id` (`battle_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

-- ----------------------------
-- Table structure for cross_player_soldier
-- ----------------------------
DROP TABLE IF EXISTS `cross_player_soldier`;
CREATE TABLE `cross_player_soldier` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `battle_id` int(11) NOT NULL,
  `player_id` int(11) NOT NULL COMMENT '玩家id',
  `soldier_id` int(11) NOT NULL COMMENT '士兵id',
  `num` int(11) NOT NULL COMMENT '数量',
  `create_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`),
  UNIQUE KEY `battle_id` (`battle_id`,`player_id`,`soldier_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

-- ----------------------------
-- Table structure for cross_round
-- ----------------------------
DROP TABLE IF EXISTS `cross_round`;
CREATE TABLE `cross_round` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `status` int(2) DEFAULT '0' COMMENT '0:报名， 1：匹配脚本运行开始，2：匹配脚本运行结束，3：处于比赛中状态，4：待发奖状态，5：整轮比赛结束',
  `create_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT 'time created',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


